import { Button, Typography } from "@mui/material";
import React from "react";

function Nthpage(props) {
  return (
    <div>
      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-evenly",
        }}
      >
        <div style={{ width: 500 }}>
          <Typography variant="h1">
            Build a business & create a community with edvi
          </Typography>
          <Typography>
            A partnership with edvi offers you the best platform for seamless
            live classes & the perfect portal to take your business forward
          </Typography>
          <Button>Contact Us</Button>
        </div>
        <div>
          <img
            src="https://edvi.app/static/media/business-bg.8f5622b2.webp"
            height="400px"
            width="500px"
          />
        </div>
      </div>
    </div>
  );
}

export default Nthpage;
